  },
  { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
  {
    id: "e3",
    title: "Car Insurance",
    amount: 294.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: "e4",
    title: "New Desk (Wooden)",
    amount: 450,
    date: new Date(2021, 5, 12),
  },
  {
    id: "e5",
    title: "New Graet",
    amount: 450,
    date: new Date(2021, 7, 4),
  },
  {
    id: "e6",
    title: "New Desden",
    amount: 423,
    date: new Date(2021, 6, 14),
  },
];

export default ExpensesData;
